function VideoFilm(){
    const [listfilm, setListfilm] = useState([]);
    useEffect(()=> {
        setListfilm(test);
    },[listfilm]);
    return(
        <div className = "container-sm w-100">
            <div className = "VideoFilm">
                
            </div>
            <div className = "TapPhim">
                {
                    listfilm!=undefined && (
                        <React.Fragment>
                            {
                                listfilm.map((router,index) =>{
                                    return(
                                        <button key = {index} className = "col-sm-1">{index}</button>
                                    )
                                })
                            }
                        </React.Fragment>
                    )
                }
            </div>
        </div>
    )
}

export default VideoFilm;
